   "source": [
    "We will find it useful to modify the dataframe to incorporate specific features for the analysis. Separate columns for the hour, weekday, month, year, and ride duration will be useful for our analysis. That can be produced using the following code."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 12,
   "id": "17b50e54",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2022-09-11T17:08:20.748134Z",
     "iopub.status.busy": "2022-09-11T17:08:20.746224Z",
     "iopub.status.idle": "2022-09-11T17:08:45.217661Z",
     "shell.execute_reply": "2022-09-11T17:08:45.215636Z"
    },
    "papermill": {
     "duration": 24.493688,
     "end_time": "2022-09-11T17:08:45.221359",
     "exception": false,
     "start_time": "2022-09-11T17:08:20.727671",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "#easily usable date column\n",
    "cyclistic$date <- as.Date(cyclistic$started_at)\n",
    "\n",
    "#the hour of the day a trip is started\n",
    "cyclistic$start_hour <- strftime(cyclistic$started_at, \"%H\")\n",
    "\n",
    "#the day of the week (numerically and an abbreviation)\n",
    "cyclistic$weekday <- paste(strftime(cyclistic$date,\"%u\"), '-', strftime(cyclistic$date, \"%a\"))\n",
    "\n",
    "#whether the trip is on a weekday or weekend\n",
    "cyclistic$day_type <- ifelse(wday(cyclistic$date) == '1' | wday(cyclistic$date) == '7',\n",
    "                                   'weekend',\n",
    "                                   'weekday')\n",
    "#the month and year of the trip\n",
    "cyclistic$month_year <- paste(strftime(cyclistic$date, \"%m\"), '-', strftime(cyclistic$date, \"%Y\"))\n",
    "\n",
    "#length of the ride in seconds\n",
    "cyclistic$duration_s <- as.numeric(cyclistic$ended_at - cyclistic$started_at)\n",
    "\n",
    "#length of the ride in minutes\n",
    "cyclistic$duration_min <- cyclistic$duration_s/60"
   ]
  },
