    "# \"dist\" contains how many number of casuals and members present in the dataset and their percentage\n",
    "dist <- cyclistic %>%\n",
    "            group_by(member_casual) %>%\n",
    "            summarize(count = length(ride_id),\n",
    "                     percent = round((length(ride_id) / nrow(cyclistic)) * 100 ))\n",
    "dist\n",
    "            "
   ]
