    "ggplot(cyclistic, aes(month_year, fill=member_casual)) +\n",
    "    geom_bar() +\n",
    "    labs(x=\"Month\", title=\"Fig. 3: Distribution by Month\") +\n",
    "    theme_grey(base_size = 20) +\n",
    "    scale_y_continuous(labels = scales::comma)"
   ]
  },
