   "source": [
    "The monthly breakdown reveals that, in comparison to the warmer months, total ridership ***declines precipitously in the winter***. This makes sense and should be anticipated for any outdoor activity during the bitterly cold winters in Chicago. As opposed to casual riders, annual members are more likely to continue using Cyclistic during the winter. Which is consistent with our description of casual riders who use the bikes for leisure. The greatest time to aim promotions towards casual riders is during the months of mid-spring to mid-fall, when there are the most casual riders.\n",
    "\n",
    "**How do the two rider groups compare when we look at the hour the ride is initiated?**"
   ]
  },
