    "display(20,10)\n",
    "ggplot(cyclistic, aes(start_hour, fill=member_casual)) +\n",
    "    geom_bar() +\n",
    "    labs(x=\"Start Hour\", title=\"Fig, 5: Distribution by Start Hour on Weekdays vs. Weekends\") +\n",
    "    theme_grey(base_size = 20) +\n",
    "    facet_wrap(~ day_type) +\n",
    "    scale_y_continuous(labels = scales::comma)"
   ]
