   "source": [
    "The fact that there is no overlap in the top five start stations between the two user groups interests me much. Also noteworthy is how frequently tourist sites appear on lists of casual cyclists. Although I don't know much about Chicago, the words \"Park,\" \"Aquarium,\" and \"Theater\" being on the list give it away that these are places for pleasure. This can offer a fruitful chance to attract casual riders.\n",
    "\n",
    "**We can apply the same analyis to the most frequently used end stations for each user type, as well.**"
