   "source": [
    "We can see that both user groups prefer classic bikes the most. It is noteworthy that only occasional riders use the docked bikes. Further research would be necessary to determine what constitutes a \"docked bike\" and whether it is solely accessible to leisure riders. It does appear that casual members are a little more likely than yearly members to use electric bikes.\n",
    "\n",
    "Let's look at the lengths of the rides for the two user groups. In the data, we found some duration outliers (even after removing the negative durations previously). The following code is used to produce a subset of the ride data that excludes the outliers with the longest (top 5%) and shortest (bottom 5%) durations."
   ]
